import styled from "styled-components";

const AssesStyle = {
    ContainerAsses: styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    margin: auto;
    max-width: 505px;
    max-height: 900px;
    padding-left: 100px;
    `,
    ContainerBidder: styled.div`
    position: relative;
    max-width: 400px;
    max-height: 500px;
    border: solid 1px grey;
    border-radius: 15px;
    overflow: hidden;
    margin: 65px 0 30px 0; 
    `,
    ContainerAboutBidder: styled.div`
    
    `,
    NameBidder: styled.p`
    font-size: 30px;
    `,
    AboutBidder: styled.p`
    font-size: 22px;
    `,
    ListHobbies: styled.ul`
    display: flex;
    `,
    ContainerBtns: styled.div`
    :first-child {
        margin-right: 25px;
    }
    `,
    Btn: styled.button`
    width: 70px;
    height: 70px;
    margin: auto;
    padding: 10px;
    border-radius: 45px;
    background-color: #80808000;
    `
}

export default AssesStyle
